export class ObjectMap {
    constructor() {
        // Entities
        this.add = (key, entity) => {
            this.entities[key] = entity;
        };
        this.forceGet = (key) => {
            if (!this.entities[key])
                throw new Error(`[ObjectMap] ${key} not found`);
            return this.entities[key];
        };
        this.get = (key) => {
            return this.entities[key];
        };
        this.getAll = () => {
            return Object.values(this.entities);
        };
        this.getAllKeys = () => {
            return Object.keys(this.entities);
        };
        this.forEach = (callbackfn) => {
            return Object.keys(this.entities).forEach(key => {
                callbackfn(this.entities[key], key);
            });
        };
        this.map = (callbackfn) => {
            return Object.keys(this.entities).map(key => {
                callbackfn(this.entities[key], key);
            });
        };
        this.length = () => {
            return Object.keys(this.entities).length;
        };
        this.remove = (key) => {
            delete this.entities[key];
        };
        this.entities = {};
    }
}
